import Vue from 'vue'
import VueRouter from 'vue-router'

let Home = () => import('../components/Home');
let Contact = () => import('../components/Contact');
let Team = () => import('../components/Team');
let News = () => import('../components/News');
let Search = () => import('../components/Seach.vue');

Vue.use(VueRouter);
const router = new VueRouter({
  routes: [
    {
      path: '/',
      redirect: '/home'
    },
    {
      path: '/home',
      component: Home,
    },
    {
      path: '/Contact',
      component: Contact,
    },
    {
      path: '/Team',
      component: Team,
    },
    {
      path: '/News',
      component: News,
    },
    {
      path: '/Search',
      component: Search,
    },
  ]
});


export default router
